import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { WelcomePageComponent } from './welcome-page/welcome-page.component';
import { QuizPageComponent } from './quiz-page/quiz-page.component';
import { DashboardHighscoreCategoryComponent } from './dashboard-highscore-category/dashboard-highscore-category.component';
import { DashboardQuestionsComponent } from './dashboard-questions/dashboard-questions.component';
import { LoginPageComponent } from './login-page/login-page.component';

@NgModule({
  declarations: [
    AppComponent,
    WelcomePageComponent,
    QuizPageComponent,
    DashboardHighscoreCategoryComponent,
    DashboardQuestionsComponent,
    LoginPageComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
